- input: "TEXT\x1CC00044842\x1C1\x1C\x1CF3XA\x1CArena Strategies received $6,634.17
    for consulting.  They used the funds for the memoed disbursements attached to
    the record, however note that they did not use all the money provided to them
    for their services.  A refund check for the remaining funds was received by the
    Committee after this reporting period, so will be reflected in the Year End Report.
    \ Arena Strategies also received $9,044 for the following Independent Expenditures
    memoed in this report:  Republican City Committee, Philadelphia Asian News, El
    Torrero Spanish Newspaper, News Gleaner, Philadelphia Asian News, The Ukrainian
    Weekly, North East Times and Viet My Magazine. Andrew Fick and Christy Schlottman
    received $1500 each for election day consulting.  Both used the funds for Volunteer
    Food, Services and Training.  Neither used all the funds provided, and as such
    the Committee received refunds that will be reported in the Year End Report.  An
    Independent Expenditure was reported Nov. 3, 2008 to Brabender Cox in the amount
    of $25,000 for a Television Ad Opposing then Presidential Candidate Barrack Obama.
    \ This was the original amount quoted by the vendor.  Note that the same Independent
    Expenditure is reported here but reflects the actual amount invoiced and paid
    of $17,050.  Arena Strategies also received $9,000 and $78,364.51 for consulting.
    \ In addition to their consulting fee of $2,900, these funds were used for a variety
    of activities including:  election day expenses such as volunteer food, canvassing,
    printing costs, GOTV activities and electronic outreach. Nick Sinatra was hired
    to do generic party fundraising for the state party federal account, no specific
    candidate.  Alliance Strategies was used as a consultant for Jewish outreach activities.
    \ "
